  for(let i = 1; i < nums.length; i++) {
    let currentValue = nums[i];
     if(currentValue === nums[i-1] && currentValue === nums[i+1]) {
       isNotExistTriples = false;
       break;
     }
  }

  return isNotExistTriples;
}

