frontBack-code:
function frontBack(str){
  let strLn = str.length;
  if (strLn < 2) return str;

  let tempText = "";

  for (let i = 1; i < strLn - 1; i++) {
    tempText += str[i];
  }

  return str[strLn - 1] + tempText + str[0];
}

